import React from 'react'
import './style.css'
import {Images} from '../../config/image'
function Component_Ngang() {
    return (
        <div>
            <div className="box-ngang">
                <img src={Images.BAR_CHART}/>

            </div>
        </div>
    )
}

export default Component_Ngang
